import * as React from 'react'
import * as ReactDOM from 'react-dom'
import SplitPane from 'react-split-pane';

import './style.css';

function App() {

  return (
    <div>
      <SplitPane split="vertical" defaultSize={200} primary="second">
        <div>Hello</div>
        <div>Bye</div>
      </SplitPane>
    </div>
  );
}

export default App;
